FIRST RELEASE

Bioartnergy 5 proudly present
LOMBA POSTER ILMIAH

Heeyyo apa kabar Sobat Bumi?!
Saat ini bumi dalam keadaan sekarat karena cekaman teknologi jahat. Bumi membutuhkan seorang pahlawan untuk menyelamatkannya. Apakah kamu salah satu pahlawan yang disebut - sebut?
Yukk tuangkan ide - ide kreatifmu dalam Lomba Poster Ilmiah sebagai wujud kepedulianmu terhadap bumi tercinta!

Lomba Poster Ilmiah ini mengangkat SUBTEMA: -Zero Waste
-Architect of Future Indonesia
-Internet of Things

Batas pengiriman karya adalah tanggal 14 September 2017 pukul 23.59 WIB.

Ketentuan lebih lanjut dapat di lihat di http://ugm.id/PanduanPosterBioartnergy5

Pendaftaran online klik
ugm.id/LPI-Bioartnergy5

Jadi, tunggu apa lagii? Ayo segera kirimkan karya terbaikmu!

